import React, { Component } from "react"
import NavBar from "./navbaradmin.js"
import SideBarAdmin from './sidebaradmin.js'

class adminpanel extends Component{
    render(){
        return(
            <div>
                <NavBar />
                <SideBarAdmin />
                
            </div>
        )
    }
}


export default adminpanel
